import React from "react";
import "./Finish.css";
import img from "./backgr"

function Finish() {
  return (
    <div
      className="finish"
      style={{ backgroundImage: `url(${img})` }}
    >
      <div className="finish__container">
        <p>hello</p>
      </div>
    </div>
  );
}

export default Finish;
